import{_ as a,c as e,o as t,a2 as s}from"./chunks/framework.Cw_AIpAc.js";const o="/%E5%B0%8F%E7%B1%B3su7%E6%B5%B7%E6%B9%BE%E8%93%9D.png",r="/23%E5%B9%B4%E7%9A%84%E9%9B%AA.png",B=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"essay1.md","filePath":"essay1.md"}'),n={name:"essay1.md"},_=s('<h2 id="小米汽车前瞻" tabindex="-1">小米汽车前瞻 <a class="header-anchor" href="#小米汽车前瞻" aria-label="Permalink to &quot;小米汽车前瞻&quot;">​</a></h2><p>  一觉醒来感觉不是很好，身体头疼加感冒。哎！熬过这段时间就好了，记录一下今日事件。小米汽车技术及预发布会今日举行。作为米粉和雷粉，看了一个下午的发布会，看雷总介绍着一个个遥遥领先的技术也是不得不佩服雷总的魄力和小米顶级的供应链整合能力。秉承着<strong>十倍投入认认真真做好车</strong>的理念，历经1000天投入了100多亿。在今天也是收获了鲜花和掌声！我是真的喜欢这个车子的，外观、内饰、性能、车机等，真的做的不错！在未来也是有计划购入小米SU7，毕竟小米用户也到了用车的年纪了！</p><p><img src="'+o+'" alt="小米su7"></p><h2 id="面试" tabindex="-1">面试 <a class="header-anchor" href="#面试" aria-label="Permalink to &quot;面试&quot;">​</a></h2><p>  今天的有一个意外之喜，大早上迷迷糊糊就收到了字节跳动的电话，说是我通过了它们部门的简历初筛，然后联系我具体的面试时间。没想到字节居然邀我面了，确实挺不可思议的。之前没想过会发生，毕竟技术一般，学历一般，能力一般...哈哈哈！见识见识大厂的压力面，就当做一次体验，虽然知道自己肯定是过不了的，但也需要这样的机会磨练自己。今晚又收到面试邀请，明天两场下周一场，明天在投一天然后就结束了，如果没有收到offer就是说明自己还是准备不够充分或者是年底公司不招人了！收拾收拾回家过年，去看许久未见的老友。来年开春继续战斗！</p><h2 id="总结" tabindex="-1">总结 <a class="header-anchor" href="#总结" aria-label="Permalink to &quot;总结&quot;">​</a></h2><p>  还有4天就到2024了，时间过得很快。相信自己刚上大一那会儿的稚嫩还挺好笑的，不过这些东西总是需要经历和成长的。人就是需要在不断的经历和体验过程中才能够成长。体验失败的痛苦和不甘，体验成功的喜悦还满足，这些都是我们都是有利于我们的自我成长！我觉得我需要写作，把自我的经历和情绪通过文字传递会是一种很好的方法！回顾2023我收获了什么？我在哪方面取得了进步？这些都是需要总结的，在今年我的技术得到较大的成长和进步！我的心态也越发趋近成熟，但是在情绪的控制上还是做的不够好。没有挂科应该也算一种收获吧！</p><img src="'+r+'" style="zoom:23%;">',8),c=[_];function i(l,p,d,h,m,f){return t(),e("div",null,c)}const E=a(n,[["render",i]]);export{B as __pageData,E as default};
